import React from 'react';
import './scss/app.scss';
import { Routes, Route } from 'react-router-dom';
import MainPage from './components/mainPage';
import NotFoundBlock from './components/NotFoundBlock';
import Header from './components/header';
import Footer from './components/footer';
import Analyze from './components/AnalyzeBlock';
import SignUp from './components/SignUpBlock';
import SignIn from './components/SignInBlock';

function App() {
  return (
    <div className="wrapper">
      <Header />
      <div className="content">
        <div className="container">
          <Routes>
            <Route path="/" element={<MainPage />} />
            <Route path="/not-found" element={<NotFoundBlock />} />
            <Route path="/analyze" element={<Analyze />} />
            <Route path="/sign-in" element={<Analyze />} />
            <Route path="/sign-up" element={<SignUp />} />
          </Routes>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default App;
